import routes from "./routes";
import "./HomeStyle.css";
import { Link } from "react-router-dom";

function ManiLink(props) {
  return <p className="mani-link"> {props.name} </p>;
}

function Links() {
  return (
    <>
      {routes.map((e, i) => (
        <div key={i}>
          <Link to={e.path}>
            <ManiLink name={e.name} />
          </Link>
        </div>
      ))}
    </>
  );
}

export default Links;
